<ul>
<li><code>&amp;&amp;</code>:逻辑与(AND)</li>
<li><code>||</code>:逻辑或(OR)</li>
<li><code>!</code>:逻辑非(NOT)</li>
</ul>
<blockquote>
<p>&amp;&amp;此运算符用于验证两个表达式是否都为真.如果都为真,则整个表达式的结果为真.如果其中一个或两者都为假,则整个表达式的结果为假.</p>
